import React from "react";
import { StyleSheet, View } from "react-native";
import Wind from "../components/Wind";

const Test = () => {
  return (
    <View style={styles.container}>
      <Wind />
    </View>
  );
};

export default Test;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
});
